var getColor = function (feature) {
		return 	(feature.properties.eehrs_total > 168) ? '#006d2c' :
				(feature.properties.eehrs_total > 126) ? '#2ca25f' :
				(feature.properties.eehrs_total > 84) ? '#66c2a4' :
				(feature.properties.eehrs_total > 42) ? '#b2e2e2' :
					'#edf8fb';
}

var getRadius = function (feature) {
		return 	(feature.properties.eehrs_total > 168) ? 12 :
				(feature.properties.eehrs_total > 126) ? 10 :
				(feature.properties.eehrs_total > 84) ? 8 :
				(feature.properties.eehrs_total > 42) ? 6 :
					4;
}


//Initializes map on window ready event
$(window).ready(function() {
	
	//instantiates map object with initial zoom, max zoom, min zoom, and center properties
	 var map = L.map('map', 
			{
            center: [ 40.075, -105.2 ],
            zoom: 11,
            maxZoom: 15,
            minZoom: 10
        });

	//adds tile layer from Mapbox
	L.tileLayer('https://a.tiles.mapbox.com/v3/jonathancduckworth.il6o28fp/{z}/{x}/{y}.png',
		{attribution: 'Basemap tiles &copy; <a href = "www.mapbox.com">Mapbox</a><br />Env. Education Data from BCEE Assessment 2013'}).addTo(map);
	
		
	//Create JSON layer from elementaryJSON data and add to map
	var schoollayer = L.geoJson(schoolJSON, 
		{
			pointToLayer: function (feature, latlng) {
				return L.circleMarker(latlng, {
					color: '#006d2c',
					weight: 1,
					opacity: 1,
					fillColor: getColor(feature),
					fillOpacity: 0.8,
					radius: getRadius(feature)
				});
			},

			onEachFeature: function (feature, layer) {
         		layer.bindPopup('<h3>' + feature.properties.school + '</h3><p>Total EE Hrs.: ' + feature.properties.eehrs_total + '<br /> Total Students: ' + feature.properties.students_total + '</p>'
         		);
         	}
		});

	schoollayer.addTo(map);
	
});

